    }

    contentToShow(){
        return (
            <div>
                <SetTable/>
                <div>
                <button>Start!</button>
                </div>
            </div>

        )
    }



    render() {
        return(
            <div>
                <h1>SET Card Game</h1>
                {this.contentToShow()}
            </div>
        )
    } 
}

export default App;
